import React from 'react';
import '../assets/css/App.css';
import avatar from "../assets/images/icon_avatar.png";
import address from "../assets/images/icon_address.png";
import phone from "../assets/images/icon_phone.png";
import email from "../assets/images/icon_email.png";
import facebook from "../assets/images/logo_facebook.png";
import twitter from "../assets/images/logo_twitter.png";
import instagram from "../assets/images/logo_instagram.png";

export default class Footer extends React.Component {
  render() {
    return (
    <div>
      <nav className="navbar fixed-bottom navbar-light bg-light" >
        {/* <p className="navbar-brand" id="footer">© 2018-2020, web@cademie Ambition féminine </p> */}
        <div>
                <h2>Contact :</h2>
                <ul id="contact">
                    <li><img src={avatar} alt="Icone d'avatar"/><address>Programme spatiale G·PigX</address></li>
                    <li><img src={address} alt="Icone d'adresse"/><address>14 allée des daims, 91800 BRUNOY</address></li>
                    <li><img src={phone} alt="Icone de télephone"/><address>07 50 45 13 05</address></li>
                    <li><img src={email} alt="Icone d'email"/><address>contact@gpigX.fr</address></li>
                </ul>
            </div>
            <div id="footer_middle">

                <p id="footer_text">Web@cademie - Ambition Féminine - 2019</p>
            </div>
            <div>
                <h2 id="social_title">Nos réseaux sociaux :</h2>
                <ul id="social">
                    <li><a href=""><img src={facebook} alt="Logo facebook"/></a></li>
                    <li><a href=""><img src={twitter} alt="Logo twitter"/></a></li>
                    <li><a href=""><img src={instagram} alt="Logo instagram"/></a></li>
                    <li><a href=""><img src="../assets/images/logo_googleplus.png" alt="Logo google +"/></a></li>
                </ul>
            </div>
      </nav>
    </div>
    );
  }
}
